        height: 100%;
        flex-direction: column;
      }

      .title {
        font-size: 65px;
        font-weight: 700;
        line-height: 105px;
        letter-spacing: 0.05em;
        text-align: center;
      }

      .sub-title {
        text-align: center;
        font-weight: 700;
        font-size: 32px;
        line-height: 48px;
      }

      .users {
        display: flex;
        align-items: center;
        gap: 130px;
        justify-content: center;
      }

      .user {
        display: flex;
        align-items: center;
        flex-direction: column;
        gap: 20px;
        position: relative;
      }

      .user-name-container {
        height: 70px;
      }

      .user-name-box {
        width: 100%;
        top: 0;
        position: absolute;
        display: grid;
        place-items: center;
      }

      .user-name {
        font-style: normal;
        font-weight: 800;
        font-size: 40px;
        line-height: 40px;
        color: #7f39fb;
        text-align: center;
      }

      .user-image {
        position: relative;
        width: 100%;
        height: 100%;
      }

      .image {
        border: 5px solid rgba(242, 221, 255, 0.8);
        position: absolute;
        top: 42px;
        left: 42px;
        border-radius: 50%;
        width: 300px;
        height: 300px;
        background-position: center;
        background-size: cover;
        background-repeat: no-repeat;
      }

      .heart {
        padding-top: 35px;
      }

      .text-curve {
        font-family: "Roboto Mono", monospace;
        font-style: normal;
        font-weight: 700;
        font-size: 32px;
        line-height: 32px;
        letter-spacing: 4.1px;
        opacity: 0.7;
      }

      .blockhain {
        padding: 10px 80px;
        padding-bottom: 20px;
        display: flex;
        gap: 400px;
        position: relative;
      }

      .stamp {
        position: absolute;
        left: 40%;
        top: 15px;
      }

      .stamp-code {
        position: absolute;
        top: 10px;
        left: 11px;
      }

      .stamp-curve {
        font-family: "Roboto Mono", monospace;
        font-style: normal;
        font-weight: 700;
        font-size: 10.5px;
        line-height: 13px;
        letter-spacing: 2.25px;
      }

      .section {
        display: flex;
        flex-direction: column;
      }

      .section-info {
        display: flex;
        gap: 5px;
      }

      .section-name,
      .section-data {
        font-size: 32px;
        font-weight: 700;
        line-height: 48px;
      }

      .section-data {
        color: #7f39fb;
      }

      .stamp-hearts {
        position: absolute;
        top: -5px;
        left: -2px;
      }

      .stamp-logo {
        position: absolute;
        top: 33px;
        left: 33px;
      }

      .w3id {
        position: absolute;
        top: 10px;
        left: 47%;
        font-size: 24px;
        font-weight: 600;
        line-height: 36px;
        text-align: center;
        color: white;
        mix-blend-mode: soft-light;
      }
    </style>
